import React from "react";
import image from "./assets/images/home-page-slider-04.png";
const Home = () =>{
    return (
        <>
        <div className="home_page">
            <div className="banner">
                <img alt="banner" src={image} /><h1>hello</h1>
            </div>
            <div className="container"><h1>hey</h1></div>
        </div>
        </>
    )
};
export default Home;
